import React from "react";
import styles from "../styles/NexusStocks.module.scss";

class NexusStocks extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            stocks: []
        };

        var _ = new Promise((resolve, reject) => {
            fetch("/api/stocks",  {
                method: "GET",
                headers: {
                    "Content-Type": "application/json",
                    "Accept": "application/json"
                }
            
            })
                .then(res => res.json())
                .then(
                    (result) => {
                        resolve(result);
                    },
                    (error) => {
                        reject(error);
                    }
                )
        });

        _.then((result) => { 
            this.setState({ stocks: result });
            console.log(result);
         });
    }

    render() {
        return (
            <>
                <div className={styles.mainDiv}>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                    <div className={styles.stockDiv}></div>
                </div>
            </>
        );
    }
}

export default NexusStocks;
